import {Link} from 'react-router-dom';
import "./home.css";

const Home = () => {
    return (
        <div className="home">
            
            <h1>online store</h1>
            <h4>the store for athletes</h4>
           
            <Link className="btn btn-lg btn-light" to="/catalog">
                check out my catalog
            </Link>
            
        </div>
    );
};
 

export default Home;
